<h2>CSectdat</h2>

<h3>Description</h3>

<p><code>CSectdat</code> is data from <a href="https://obgyn.utoronto.ca/hospital-statistics">Obstetrics and Gynaecology, University of Toronto</a>
</p>

<ul>
<li> <p><code>Hospital</code> - <code>MG</code> or <code>NYG</code>
</p>
</li>
<li> <p><code>CSecthosp</code> - Indicator of C-section (1 = yes, 0 = no)
</p>
</li>
</ul>
<h3>Usage</h3>

<pre><code class="language-R">CSectdat
</code></pre>


<h3>Format</h3>

<p>R data frame.
